INSERT INTO `inv_productos` (`id`, `codigo`, `nombre`, `id_categoria`, `id_linea`, `id_sublinea`, `descripcion`, `id_unidad_medida`, `id_marca`, `fl_estado`, `cantidad`, `cantidad_minimo`, `costo`, `precio`, `fecha_sistema`, `id_usuario`, `id_membresia`, `observacion`, `codigo_barra`, `imagenes`, `fl_publico`, `id_empresa`, `id_almacen`, `fl_cantidad_qr_unico`, `id_catalogo_empresa`) VALUES
	(1, NULL, 'Coricaballo', 1, 15, 20, '<p>Coricaballo, Alimento formulado para potrillos a partir Alimento formulado para caballos adultos, a de los 6 meses de edad. Es un alimento formulado con buena energía, fibra y porcentaje de grasa adecuada para caballos adultos.</p>', 10, 6, 1, 65.00, 12.00, 35.00, 39.00, '2025-03-01 22:14:16', 23, 1, 'CZXCZXC', '1234', 'productos-1763873666_c1fe41f7eb444b737bfd.jpg', 1, 1, 4, NULL, 1),
	(2, NULL, 'CoriVacuno', 1, 13, 22, '<p>Alimento ideal para vacas de alta producción lechera (Superior a los 30 Lt. /día) por su elevada calidad nutricional del alimento.</p>', 10, 7, 1, 13.00, 2.00, 2360.00, 50.00, '2025-03-11 11:31:26', 23, 1, 'ZXZXXXX', '12345678789', 'productos-1763873952_3336b67b43ed69b9365c.jpg', 1, 1, 4, NULL, 2),
	(3, NULL, 'Conceptase', 1, 13, 22, '<p>Conceptase, es un Análogo sintético de la hormona liberadora de gonadotropinas (GnRH). Su efecto consiste en la estimulación de la secreción de las hormonas luteinizante (LH) y folículo estimulante (FSH).</p>', 10, 6, 1, 0.00, 2.00, 0.00, 35.00, '2025-09-15 22:22:48', 23, 1, 'FSDFSDF', '', 'productos-1763874057_4b471650d05f348f0394.jpg', 1, 1, NULL, 1, 3),
	(167, NULL, 'Estrovet', 1, NULL, NULL, '<p>Estrovet, es una potente hormona estrogénica natural. Induce los cambios propios del celo en el tracto reproductivo de las hembras; es decir relajación e incremento del flujo cervical, hiperemia, aporte de leucocitos e incremento del tono uterino, con lo cual se consigue elevar la resistencia a las infecciones del endometrio, evacuar contenidos patológicos y restituir la capacidad reproductiva del útero.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 45.00, '2025-11-22 23:02:38', 23, 1, '', '', 'productos-1763874158_196e21bca7408f65d24d.jpg', 1, 1, NULL, NULL, 1),
	(168, NULL, 'Lutaprost', 1, NULL, NULL, '<p>Lutaprost, potente agente luteolítico que induce la regresión funcional y morfológica del cuerpo lúteo (luteólisis). Luego de 2 a 4 días, dicha luteólisis es seguida por retorno al estro con ovulación normal.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 34.50, '2025-11-22 23:04:10', 23, 1, '', '', 'productos-1763874250_d018062aaa117c65962d.jpg', 1, 1, NULL, NULL, 1),
	(169, NULL, 'Acigib 10%', 2, NULL, NULL, '<p>Acigib 10% tabletas, un regulador de crecimiento que ocurre naturalmente en las plantas. Esta hormona vegetal estimula e induce una floración más uniforme, mejora el cuajado de los frutos, regula la maduración de los frutos e interrumpe la latencia de las semillas, tubérculos y bulbos.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 25.00, '2025-11-22 23:07:08', 23, 1, '', '', 'productos-1763874428_ebc36947cc35a7b1e25c.jpg', 1, 1, NULL, NULL, 2),
	(170, NULL, 'Biozyme TF', 2, NULL, NULL, '<p>Biozyme TF, Es un regulador de crecimiento de los cultivos, responsable del desarrollo armónico y equilibrado de la planta. Maximiza todos los procesos de crecimiento y diferenciación, a través de su efecto sobre la división y elongación celular, atracción de sustancias de reservas y llenado de tejidos.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 28.90, '2025-11-22 23:08:36', 23, 1, '', '', 'productos-1763874516_46e62d160c59d004db50.jpg', 1, 1, NULL, NULL, 2),
	(171, NULL, 'Orgabiol', 2, NULL, NULL, '<p>Orgabiol, Es un Bionutriente de naturaleza orgánica, de total asimilación por las plantas, cuya función es la activación de ciclos metabólicos específicos a nivel celular, los cuales se encuentran deprimidos por los efectos adversos de los factores medioambientales. Diseñado para recuperar la formación de hormonas internas en las plantas, necesarias para optimizar y restablecer los procesos de crecimiento, floración, cuajado de frutos, desarrollo de frutos u otros órganos cosechables, lo que se traduce en el incremento de la productividad de los cultivos.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 32.70, '2025-11-22 23:10:03', 23, 1, '', '', 'productos-1763874603_8df221f60ae94ae214a5.jpg', 1, 1, NULL, NULL, 3),
	(172, NULL, 'Promalina', 2, NULL, NULL, '<p>Promalina, es un regulador de crecimiento que estimula la división celular, promueve el inicio del botoneo y el desarrollo y el crecimiento radicular, mejorando la calidad de la producción e incrementando las cosechas en algodón, tomate, papa, paprika, ají y marigold.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 60.00, '2025-11-22 23:12:56', 23, 1, '', '', 'productos-1763874776_dc07bc849c49c11ee6a1.webp', 1, 1, NULL, NULL, 2),
	(173, NULL, 'Raizafort', 2, NULL, NULL, '<p>Raizafort, Es un producto liquido altamente cargado en Algas marinas, L-Aminoácidos y Fósforo complejado. Constante y sostenida formación de raíces. Incrementa rápidamente el número y grosor de raíces absorbentes, así como las de anclaje.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 45.00, '2025-11-22 23:14:23', 23, 1, '', '', 'productos-1763874863_fb8f4d7255793522ae29.webp', 1, 1, NULL, NULL, 2),
	(174, NULL, 'Triggrr', 2, NULL, NULL, '<p>Triggrr Foliar, Triger es un regulador de crecimiento de plantas de origen natural, que al ser aplicado al follaje de estas proporciona hormonas y elementos menores esenciales con un adecuado balance que da como resultado un incremento significativo de los rendimientos y una mejor calidad de las cosechas.</p>', 10, NULL, 1, 0.00, 0.00, 0.00, 18.00, '2025-11-22 23:15:31', 23, 1, '', '', 'productos-1763874931_92fde248b31c5e12a051.webp', 1, 1, NULL, NULL, 3);
